#!/bin/sh

. ../bash_functions.sh

C=400
REQ=300000
MOD=100

if [ -z "$1" ]; then
  echo "Usage: $0 server-ip"
  exit 1
fi
HOST="$1"
if [ -n "$2" -a "$2" == "TEST" ]; then
  C=1
  REQ=1
fi

#TASKSET="taskset -c 1 "
TASKSET=""
ARGS=" -h ${HOST} -q "

pushd ..

function recreate() {
  $CLI -h ${HOST} DROP TABLE sessions
  $CLI -h ${HOST} CREATE TABLE sessions "(id INT, account_id INT, user_id INT, timestamp INT, session__data TEXT)"
}

recreate
echo "SMALL"
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,XXXXXXX)"

recreate
echo "BIG ONE PACKET"
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo SMALL 2 PACKETS
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo BIG 2 PACKETS
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo SMALL 3 PACKETS
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"


recreate
echo BIG 3 PACKETS
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo small 4  PACKETS
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

recreate
echo 5K
$TASKSET ./gen-benchmark $ARGS -c $C -n $REQ -s -m $MOD -A OK -Q INSERT INTO sessions VALUES "(000000000001,000000000001,000000000001,1234567,)"

popd
